                    text: "To skip flying, go to 2:10\n$99 TinyHawk: https://goo.gl/LrQiN9, https://goo.gl/8y66Gf\nBattery options: https://goo.gl/nruwxx, I'm looking for a 600mah option which they say gives more flight time but I can't find one with the appropriate wire.\nThe charger I recommend: https://goo.gl/mqy8DT\n\nI totally forgot to mention that the motors on this thing have bearings which are SIGNIFICANTLY better than the bushings on nearly all other whoops out there.  Bearing whoop motors tend to be a lot more expensive.  They perform awesome and should keep doing so much longer than the bushing motors.\n\nBefore you tell me not to fly high, the thing weighs ~40g AUW.  There are bags flying in the sky that weigh more.  I've also run this thing into my own face at full speed by accident (because I'm dumb) and nothing happened.  I barely even felt it.\n\nIt's also got smart audio but be careful, Emax has locked out all the illegal channels.  If you smart audio to one of them by accident you'll be playing with the channel changer button on the top to find a channel you can see on again.  There are shockingly few channels that are 'unlocked' when you first get it.  You're supposed to be able to unlock the channels by holding he channel button while powering it up but I wasn't able to unlock it.\n\nThe Alienwhoops are actually an F0 processor which is similar to an F4.\n\n\nMy Tune:\n\nFirst off, set your landing/warning voltage to 2.9v and your warning voltage to 3.2v.  This is a non-issue with 1S as you can't really pull enough amps on this thing to actually damage the battery much.\n\nMake sure it's set to 8k/8k and I recommend Multishot with min throttle at 1175\n\nRoll and Pitch are the same numbers: P 90, I 70, D 55 FF 45, RC Rate 1.38, rest default\nYaw: P 80, I 60, D 0, FF 45, RC Rate 1.38, rest default\n\nIterm relax on and on defaults, the other three switches above it off.\n\n\nThe song at the beginning: https://soundcloud.com/seankrell/ipz\n\n\nTips?\nBitcoin: 1E4XZXoD4rS6MYWVWuenY7Kw2M1YgyNpoQ\nNano: xrb_1188ek5bd7tb9kw67asnp9o65byuoaxbtpxuznx1ribf75x78awywmakj55f\nETH: 0xD067F93811f2eC31CB1928901002dfdf9A492EF5\nLTC: La2KWYAjp4VT2Lq2M76pbjzXWvRyjpfCtG",
